  textTransform: "uppercase"
},
title: {
  fontSize: 14,
  color: '#368cb3',
  marginBottom: -2,

},
activityIndicator: {
  flex: 1,
  justifyContent: 'center',
  alignItems: 'center',
  height: 180
},
appButtonContainer: {
  marginTop: 10,
  backgroundColor: "#368cb3",
  borderRadius: 25,
  height: 30,
  width: 128,
  paddingVertical: 10,
  paddingHorizontal: 1
},
appButtonText: {
  marginTop: -5,
